import Apresentacao from '../../componentes/projetosApresentacao/projetos-inicio';
import projetosLista from '../../componentes/projetosLista/projetos-lista';
export default function ProjetosPortifolio() {
    return (
        <main
            style={{
                backgroundImage: `url('../../img/background-projects.png')`,
                backgroundRepeat: 'no-repeat',
                backgroundSize: 'cover',
            }}
        >
            <Apresentacao />
            <ProjetosLista />
        </main>
    );
}
